result:
.statistics {
    min-width: 700px;
}

.up,
.el-icon-caret-top {
    color: #F5222D;
    font-size: 12px;
    opacity: 1 !important;
}

.down,
.el-icon-caret-bottom {
    color: #39C15B;
    font-size: 12px;
    opacity: 1;
}

.header {
    &-title {
        font-size: 16px;
        color: #000000;
        font-weight: 500;
    }

    &-time {
        font-size: 12px;
        color: #8C8C8C;
    }
}

.content {
    width: 19%;
    display: inline-block;
    border-right: 1px solid rgba(0, 0, 0, 0.1);

    &-is {
        opacity: 1%;
    }

    &-title {
        font-size: 14px;
        color: #000000;
        margin-bottom: 5px;
    }

    &-time {
        font-size: 12px;
        color: #8C8C8C;
        margin-bottom: 5px;
    }

    &-number {
        font-size: 30px;
    }
}
